import styled from "styled-components";

export const ContactContainer = styled.div`
  font-size: 30px;
  display: grid;
  place-items: center;

  h2 {
    margin: 5px;
  }
  .pattern {
    background: linear-gradient(90deg, hsl(256, 33, 10), 21px, transparent 1%),
      center, linear-gradient(hsl(256, 33, 10), 21px, transparent 1%) center,
      hsl(256, 33, 70);
    background-size: 26px 26px;
    background: linear-gradient(90deg, hsl(256, 33, 10), 21px, transparent 1%);
  }
  video {
    margin: 18px;
    border: 8px solid black;
    transform: translate(25px, -25px);
    :hover {
      border: 8px solid orangered;
    }
  }
`;
